import { Link } from 'react-router-dom';

const PassportItem = props => {
    return (
        <div className="card-container">

            <h1 className="title">{props.name}</h1>

            <Link to='/restaurants/'>View Restaurant</Link>
        </div>
    );
};

export default PassportItem;
